import React from "react";
import { TASKS } from "../data";

function Task({task}) { 
  console.log(task)
  return (
    <div className="task">
      {task.map((tsk) => (
      <React.Fragment key={tsk.text}>
      <li>
      <div className="label">{tsk.category}</div>
      <div className="text">{tsk.text}</div>
      <button className="delete">X</button>
      </li>
      </React.Fragment>
      ))}
    </div>
  );
}

export default Task;
